import React, { useState, useEffect } from 'react';
import {
  Box,
  CircularProgress,
  Button,
  Typography,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
  SvgIcon,
} from '@mui/material';

const GlassOfWaterIcon = (props) => (
  <SvgIcon {...props}>
    <path d="M7 2v3h10V2h2v3h3v2H2V5h3V2h2zm11 5v13a2 2 0 01-2 2H8a2 2 0 01-2-2V7h12zM10 9v10h4V9h-4z" />
  </SvgIcon>
);

const WaterIntake = () => {
  const [goal, setGoal] = useState(2000); // Daily water goal in ml
  const [intake, setIntake] = useState(0); // Current water intake
  const [goalDialogOpen, setGoalDialogOpen] = useState(false);
  const [intakeDialogOpen, setIntakeDialogOpen] = useState(false);
  const [inputIntake, setInputIntake] = useState('');

  const progress = Math.min((intake / goal) * 100, 100);

  // Function to reset intake at midnight
  useEffect(() => {
    const resetAtMidnight = () => {
      const now = new Date();
      const millisUntilMidnight = new Date(
        now.getFullYear(),
        now.getMonth(),
        now.getDate() + 1,
        0,
        0,
        0,
        0
      ).getTime() - now.getTime();
      setTimeout(() => {
        setIntake(0);
        resetAtMidnight();
      }, millisUntilMidnight);
    };
    resetAtMidnight();
  }, []);

  // Handle goal dialog open/close
  const handleGoalDialogOpen = () => setGoalDialogOpen(true);
  const handleGoalDialogClose = () => setGoalDialogOpen(false);

  // Handle intake dialog open/close
  const handleIntakeDialogOpen = () => setIntakeDialogOpen(true);
  const handleIntakeDialogClose = () => setIntakeDialogOpen(false);

  // Handle setting goal
  const handleGoalSubmit = (e) => {
    e.preventDefault();
    setGoal(parseInt(inputIntake, 10));
    setInputIntake('');
    handleGoalDialogClose();
  };

  // Handle adding intake
  const handleIntakeSubmit = (e) => {
    e.preventDefault();
    setIntake((prevIntake) => prevIntake + parseInt(inputIntake, 10));
    setInputIntake('');
    handleIntakeDialogClose();
  };

  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        padding: 2,
      }}
    >
      <Typography variant="h6">Water</Typography>
      <Box sx={{ position: 'relative', display: 'inline-flex', mt: 2, mb: 2 }}>
        <CircularProgress
          variant="determinate"
          value={progress}
          size={100}
          thickness={4}
          sx={{ position: 'absolute' }}
        />
        <GlassOfWaterIcon
          fontSize="large"
          onClick={handleIntakeDialogOpen}
          sx={{ cursor: 'pointer' }}
        />
      </Box>
      <Button variant="outlined" onClick={handleGoalDialogOpen}>
        Set Daily Water Goal
      </Button>

      {/* Dialog for setting daily water goal */}
      <Dialog open={goalDialogOpen} onClose={handleGoalDialogClose}>
        <DialogTitle>Set Daily Water Goal</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Daily Water Goal (ml)"
            type="number"
            fullWidth
            value={inputIntake}
            onChange={(e) => setInputIntake(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleGoalDialogClose}>Cancel</Button>
          <Button onClick={handleGoalSubmit}>Set Goal</Button>
        </DialogActions>
      </Dialog>

      {/* Dialog for adding water intake */}
      <Dialog open={intakeDialogOpen} onClose={handleIntakeDialogClose}>
        <DialogTitle>Add Water Intake</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Water Intake (ml)"
            type="number"
            fullWidth
            value={inputIntake}
            onChange={(e) => setInputIntake(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleIntakeDialogClose}>Cancel</Button>
          <Button onClick={handleIntakeSubmit}>Add Intake</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default WaterIntake;
